const App = () => {
  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">CRM Dashboard</h1>
      <div className="row">
        <div className="col-md-8">
          <LeadGraph />
          <LeadList />
        </div>
        <div className="col-md-4">
          <LeadForm onLeadCreated={() => window.location.reload()} />
          <MailForm />
        </div>
      </div>
    </div>
  );
};
